import React, { Component } from "react";
import { Col, Container, Row } from "react-bootstrap";

class Nav extends Component {
  render() {
    return (
      <nav>
        <Row className="top">
            <Container>
              <Col>
                <i class="lni lni-32 lni-sthethoscope logo"></i>
                <i class="lni lni-menu"></i>
              </Col>
            </Container>
          </Row>
      </nav>

    );
  }
}

export default Nav;
